import React from 'react'

const Signup = () => {
  return (
    <div className='leftSideInnerArea'>
      <h1>Let's set up your Account</h1>
      <p>Already have an account? <a href="/#" onClick={(e) => e.preventDefault()}>Sign in</a></p>

      <div className='formOuterBlock'>
        <div className="formGroup field">
          <input type="input" className="formField" placeholder="Your Name" name="name" required onChange={e => e.target.value} />
          <label for="name" className="formLabel">Your Name</label>
        </div>
      </div>
    </div>
  )
}

export default Signup;
